import Nbar from '../NavxFooter/NavBar';
import PresentationWeb from './Pres';
import SecSectionP from './SecSectionP';
import Foo from '../NavxFooter/Footer';
import TsectionP from './TsectionP';
import { Parallax , ParallaxLayer } from '@react-spring/parallax';

const PageF1 = () => {
    return (
      <div className='bg-white dark:bg-black'>
        <Parallax pages={6}>
          <ParallaxLayer speed={0} offset={0} factor={1}>
            <Nbar/>
          </ParallaxLayer>
          <ParallaxLayer speed={0.5} offset={1} factor={1}>
            <PresentationWeb/>
          </ParallaxLayer>
          <ParallaxLayer speed={0.8} offset={2} factor={1}>
            <SecSectionP />
          </ParallaxLayer>
          <ParallaxLayer speed={1.2} offset={3} factor={4}>
            <TsectionP /> 
          </ParallaxLayer>   <ParallaxLayer speed={1.2} offset={5} factor={4}>
            <Foo /> </ParallaxLayer>
        </Parallax>
        
      </div>
    );
  };
  
  export default PageF1;
